import React from 'react';
import {MDXProvider} from '@mdx-js/react';

const components = {
  wrapper: props => {
    <div style={{padding: 20, backgroundColor: 'tomato'}}>
      <main {...props}/>
    </div>
  }
}

const MDX = (props) => {
  return (
    <MDXProvider components={components}>
      <main {...props}/>
    </MDXProvider>
  )
}

export default MDX
